function runPDF(fname, lname, address, city, state, zip, submissionDate, notifyDate, sampleType, comment, subfname, sublname, subaddress, subcity, substate, subzip, diagDate, caseComment, extraInfo, diagKey)
{
        var imgData1 = 'data:image/jpeg;base64,';
	
	    var imgData2 = 'data:image/jpeg;base64,';
        
        var doc = new jsPDF();
        
        //images
        doc.addImage(imgData1, 'JPEG', 11, 18, 30, 19);
        doc.addImage(imgData2, 'JPEG', 168, 22, 22, 12);
        //lines
        doc.line(9, 13, 200, 13);
        doc.line(9, 41, 200, 41);
        doc.line(9, 51, 200, 51);
        doc.line(9, 61, 200, 61);
        doc.line(9, 90, 200, 90);
        doc.line(9, 105, 200, 105);
        doc.line(9, 114, 200, 114);
        //vertical
        doc.line(73, 51, 73, 61);
        doc.line(137, 51, 137, 61);
        //doc.line(166, 22, 166, 34);
        //doc.line(102, 43, 102, 64);
        doc.line(140, 105, 140, 114);
        //doc.line(102, 107, 102, 134);
        //text
            //general info
        doc.setFont("helvetica");
        doc.setFontSize(9);
        doc.setFontType("normal");
        doc.text(55, 38, "http://www.ars.usda.gov/main/site_main.htm?modecode=12-75-05-00");
        doc.text(58, 18, "U.S. Department of Agriculture - Agricultural Research Service");
        doc.text(47, 34, "Phone: 301-504-8821     Fax: 301-504-8736     E-mail: Bart.Smith@ars.usda.gov");
        doc.setFontSize(10);
        doc.setFontType("bold"); 
        doc.text(83, 22, "Bee Research Laboratory");
        doc.text(75, 26, "Building 306, Room 318, BARC-EAST");
        doc.text(85, 30, "Beltsville, MD 20705"); 
            //Title and dates
        doc.setFontSize(16);
        doc.text(70, 48, "BEE DISEASE DIAGNOSIS");
        doc.setFontType("normal");
        doc.setFontSize(8);
        doc.text(11, 56, "Date Received:");
        doc.text(76, 56, "Date Notified:");
        doc.text(140, 56, "BRL No. :");
        doc.setFontSize(12);
        doc.text(32, 57, submissionDate);
        doc.text(96, 57, notifyDate);
        doc.text(155, 57, "#NUM");
            //apiary owner
        doc.setFontSize(9);
        doc.text(30, 65, "Apiary Owner: ");
        doc.setFontSize(11);
        doc.text(18, 71, fname + " " + lname);
        doc.text(18, 76, address);
        doc.text(18, 81, city + ", " + state + " " + zip);
            //Submitted By:
        doc.setFontSize(9);
        doc.text(135, 65, "Submitted By:");
        doc.setFontSize(11);
        doc.text(121, 71, subfname + " " + sublname);
        doc.text(121, 76, subaddress);
        doc.text(121, 81, subcity + ", " + substate + " " + subzip);
            //Sample Information
        doc.setFontSize(9);
        doc.text(11, 95, "Sample Information:");
        doc.setFontSize(12);
        doc.text(41, 96, sampleType);
        doc.text(41, 101, comment);
            //Diagnosed By:
        doc.setFontSize(9);
        doc.text(11, 109, "Diagnosis By:");
        doc.text(142, 109, "Date Diagnosed:");
        doc.setFontSize(12);
        doc.text(32, 111, "Persons Long-Name");
        doc.text(167, 111, diagDate); 
            //Diagnosis
        doc.setFontSize(9);
        doc.text(11, 118, "Diagnosis:");
        doc.setFontSize(11);
        doc.text(18, 122, diagKey + " - " + caseComment);
        doc.text(18, 126, "");
        doc.text(18, 130, "");
            //Comments
        doc.setFontSize(11);
        doc.text(18, 134, extraInfo);
        doc.text(18, 138, "");
        doc.text(18, 142, "");

        doc.output('datauri');
}
